import React from 'react';
import ReactDOM from 'react-dom';

import { MuiThemeProvider } from '@material-ui/core/styles'
import xTraderTheme from '/src/assets/jss/xTraderTheme'
import App from './App';




ReactDOM.render(
  <MuiThemeProvider theme={xTraderTheme}>
    <App />
  </MuiThemeProvider>,
document.getElementById('root'));
